import React from 'react';
//import logo from './logo.svg';
//import frame from './handwithphone.png';
import back from './IMG_iOS.PNG';
// import backgroud_ios from './ios_background.png';

import './App.css';

function App() {
  return (
    <section sectionStyle={sectionStyle} className="background_ios">
      {/* <img height={667} width={375} src={back}/> */}
    </section>
  );
}

var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: `url(${back})`
};

export default App;
